import CardPromo from "./CardPromo";

export default function({ cardsArray, step, setStep }) {

  return (
    <div>
    {
      cardsArray.map(card => (
        <CardPromo key={card.id} card={card} step={step} setStep={setStep}/>
      ))
    }
    </div>
  );
}
